import React from 'react';
import { 
  Row,  
  Col, 
  Container
} from 'reactstrap';
import TopNews from '../Index/TopNews';
import RecentNews from '../Index/RecentNews';
import Category from '../Index/Category';
import CategoryNews from '../Index/CategoryNews';
import RssProviders from '../Index/RssProviders';
import Pagination from '../Util/PaginationComponent';

function Home(props){

  return(
    <div>
      <br></br>
      <TopNews />
      <Pagination />

      <br></br>
      <div className="container">
        <Row>
          <RecentNews />
          <Pagination />
          <Category />
          <RssProviders />
        </Row>
      </div>
      <br></br> 
      <CategoryNews />
    </div> 
  )

}

export default Home;
